(20, 'Danielle Gilles', 'Swellam Solution - hatla2ee.com', 'France', 'in Egypt ', 'daniellegilles83@hotmail.com', '00971529593650', 'in dubai for fews days ', '', '', '00971529593650', '\r\nWhat would be  your conditions to  collect 7000 USD owed by a company in Dubai?\r\nI have the contract and the invoices.\r\nThe company is now under the management of an Audit.! \r\n', '', 'ikoo', 'Ikoo', 'Jordan', 'IT company ', '', '', ' Building 6 -Second floor  Media City, Dubai, UAE', '', '', '', '7000  ', 'USD ', 0, 0, 0, 1, 0, 'I contacted by telephone and by mail from Paris, many times, and no one answered. I came to Dubai with no address fortunately I found the office, but it was empty, the next day I found secretaries who gave me the E mail manager but informed me that he just gone for holidays yesterday for 1 month.\r\nAnd that the company was under the control of an Audit.\r\nHow can we contact the Audit to gave them my due from the company? \r\n', 'may to september 2014', '', 0, '94.200.137.118'),
