(22, 'Simon King', 'Director', 'United Kingdom', 'BLS Media Limited', 'sam@blsmedia.co.uk', '07782103956', 'London', 'Unit 5, Hiltongrove N1, 14 Southgate Rd, London N1 3LY', '', '00442075140589', 'Media - produce magazine and on-line websites ', 'secure advertising and sponsorship ', 'Muhammed Ikram Thowfeek', 'Founder', '', 'MIT Global', 'Thowfeek@firstglobal-group.com', '0096594086860', 'Dubai ', 'Emirates Towers, Level 41, Sheikh Zayed Road, P.O Box 31303, Dubai,', '', '', '1995', 'GBP', 0, 0, 0, 1, 0, 'MIT booked an online profile in our student networking website www.me-grad.com signed a contract documents uploaded, many communication stating payment will be made and even they tried to make payment but apparently then bank rejected the transfer, asked for proof no response, we have uploaded the profile and marketing their courses. ', '01/09/2015', 'all communications are available, please let us know you process and if you can retrieve the money, should this be successful we have either clients on the same process. ', 0, '86.134.217.175'),
