(26, 'Simon England', 'Owner / CEO', 'United Kingdom', 'England Associates HR Consultancy Lt (DMCC Branch)', 's.england@englandassociates.co.uk', '00447711829583', 'JLT, Dubai', 'Unit 2703, JBC 1, Cluster G, JLT Dubai', '', '0044 7711829583', 'Recruitment  / HR services', '', 'Sumit Pathak', 'Managing Director', 'India', 'Ace Interior Design & Furniture Industry, LLC', 'director@aceid.ae', '00971 50 651 4252', 'Dubai', ' Ace Interior Design & Furniture Industry, LLC, Plot 131, Street 7, Ras Al Khor Industrial Area 2, Dubai, U.A.E. 71957 Dubai, U.A.E.', '', '', '20000', 'AED', 0, 0, 0, 0, 0, 'Many chase emails and calls.. \r\nno reason to not pay.', '23/9/2014', 'Can you assist us to collect the debt?', 0, '94.201.174.127'),
(27, 'Rasim Shakir', 'Managing Director', 'Germany', 'OPTIMAL STRUCTURES FZE', 'rasim@optimal-structures.net', '0503606916', '', '39368 Ras Alkhaima', '', '072031134', 'Engineering consultancy services', '', 'Mr. Jalal, Mr. Wazid in Folcra Beach Industrial Company', 'Folcra Beach Industrial Company', '', 'Folcra Beach Industrial Company', 'Jalal@folcrabeach.com', '0555043200', 'Abu Dhabi', 'PO Box 46536, Abu Dhabi, UAE', '00971 2 5511512', '', '18000', 'AED', 0, 1, 0, 1, 0, '', '09.01.2016', 'The debtor is not paying my invoice since 09.01.2016, although he received the engineering calculation from me. \r\nI attached both the invoice and the LPO released to my company from the debetor', 0, '109.177.46.235'),
(28, 'PERUMAL RAJENDRAN', 'FINANCE MANAGER', 'India', 'OTTOMAN HALI SANAYI VI TICARET LTD STI', 'prajendran@ottomanhali.com', '0090 5554996111', 'TURKEY', 'NO.29, O.S.B, CERKEZKOY, TEKIRDAG STATE, TURKEY- 59500', '0090 282 758 17 29', '0090 282 758 17 21', 'Debt Recovery', '', 'Gaurav Mehta', 'CFO', 'United Arab Emirates', 'Internal Line Interior Design LLC ', 'ecfo@internalline.com', '0552111420', 'DUBAI', 'P. O. Box 49353 , Dubai UAE', '', '', '69,174.00 USD', '', 0, 0, 0, 0, 1, 'Dear Sir/Madam,\r\n \r\nWe are a carpet manufacturing company based in Turkey and we have a debt collection issue with one of our Dubai customer. The details of the debt amount is as below.\r\n \r\n1. This case is 3 months old.\r\n2. Total order value is 105,744.00 USD and we had received an advance payment of 36,570.00 USD. \r\n3. Amount outstanding is 69,174.00 USD.\r\n4. We have been communicating with this customer since last 3 months and chasing balance payment before dispatch of carpet as per signed & stamped Order Agreement. \r\n \r\nPlease note that our Dubai customerâ€™s commercial manager visited our company in Turkey and negotiated with us and finalised this order. After receiving their advance payment we commenced production of carpet in good faith but now they are saying that they have cancelled this order.\r\n \r\nCan you please inform us your charges for this debt recovery.\r\n \r\nBest Regards,\r\n \r\nPerumal Rajendran ( Raj )\r\nFinance Manager \r\nOttoman Hali Sanayi Ve Ticaret Ltd Sti\r\nO.S.B, Cerkezkoy, \r\nTekirdag State, Turkey â€“ 59500.\r\nOffice Tel: 0090 282 758 17 21.\r\nMobile: 0090 555 499 61 11.\r\n', '', '', 0, '95.5.203.48'),
(29, 'Shaun Moraveg', 'United Kingdom', 'United Kingdom', '', 'shaun_oskooie@live.com', '', 'United Kingdom', 'Ox3 9lt', '', '', 'Debt collection', 'Hossein Zeidi used my power of attorney to make transfers for my perfumes and cosmetics business, he currently has an outstanding debt of $1,000,000 charged at 100% interest every 6months since 2013.', 'Hossein Zeidi', 'Dubai', 'Saint Kitts and Nevis', '', '', '', 'Office 1801, Deira Twin Towers, Baniyas Road, Dubai', 'Office 1801, Deira Twin Towers, Baniyas Road, Dubai', '', '', '$1,000,000', 'USD', 0, 0, 0, 0, 0, '', '21/03/2014', '', 0, '81.110.213.50'),
(30, 'Abderrezak', 'Managing Director', '', '', 'abderrezak@hotmail.com', '', '', '', '', '', '', '', 'UAE Based Company', 'LLC Construction Company', 'United Arab Emirates', '', '', '', '', '', '', '', '1500000 (1.5 Millions)', 'UAE Dirhams', 0, 0, 0, 0, 0, 'Dea Sir/Madam,\r\n\r\nWe have an irrevocable court order for the amount of Dhs 1.5 Million.\r\nPlease send me the recovery timeline.\r\nPlease send me your fees.', 'December 2015', '', 0, '94.59.34.170'),
(31, 'NDUNGUE ERIC NKEANGYI', 'labourer', 'Cameroon', '', 'enkeangyi@gmail.com', '503753139', 'dubai', 'Al Nahda', '+971503753139', '0557829220', 'consultant', '', 'trupti', '', '', 'permits and visa', '', '0526529876', 'albasha dubai', '', '', '', '5000 aed', 'aed', 0, 0, 1, 1, 1, 'th avove mentioned company collected my money since 03/08l2014 to give an employment visa to canada but up to today ,they have not given me any visa and refused to give back my money.', '03l08l2014', 'please react on my behave.', 0, '5.107.136.240'),
(32, 'mamoon', '', 'United Arab Emirates', '', 'tmlmoon@gmail.com', '0557895696', '', '', '557895696', '557895696', '', '', 'Zubair Ahmed', '', '', '', '', '', '', '', '', '', '', '', 0, 0, 0, 0, 0, '', '', 'Dear Team, \r\nI made deal as individual and i have agreement and cheque amounted AED 70,000/-  \r\nOther party is disappear and  dont have any information about them other than cheque and phone number which is coming switch off. \r\nPlease advise me how you can help me in this regards. ', 0, '2.50.50.58'),
(33, 'Tareq', 'GM', 'Jordan', 'LFS', 'tareq@lfs.aero', '962777775749', 'Amman', '', '', '', 'Flight Support Services', '', 'UKAS Group', 'GM', 'United Arab Emirates', '', '', '', 'Dubai', '', '', '', '', '', 0, 1, 0, 0, 0, '', '', 'would like to know more about your services and fees required ', 0, '94.249.62.125'),
(34, 'Xike', 'Mrs', 'Australia', 'individual ', 'xikeduff@gmail.com', '610417936009', 'Perth Western Australia ', '40 REGENT Ave. Mout Pleasant ', '', '61417936010', ' investor ', '', 'Timothy Robinson', '', '', 'Private crude Oil broker ', 'timothy.robinson99@yahoo.com.au', '', 'Abu Dhabi currently, just completed a job ', '9 Millers Court, Cottesloe WA 6011', '', '', '$126,000 ', 'AU$', 0, 1, 0, 0, 1, 'The debtor made a request for  the extension of the short term loan repayment date to Dec 2016. The loan is due on 27 June 2016. I refused the extension request. based on the fact that the Debtor has verbally and in Viber message,  stated that he would pay whenever he thinks is fit. ', '23 May 2016', 'Mr Timothy Robinson is a private crude oil broker. He flew in to Dubai and Abu Dhabi 22 April 16 from Toronto Canada, to purchse $6million dollars worth of crude oil for an investor Bruce from Toronto. \r\nI was in a relationship with  Mr Robinson while he is doing this job in Dubai. \r\nMr. Robinson requested fund from me  to pay for the security fees to obtain working permits, and subsequent requests of more fund to pay for the permit fees with Eadad oil and gas consulting company. \r\nI entered a short term loan agreement with Mr Robinson. And made multiple of four international money transfers to the nominated accounts in Dubai,  total of $126,000.\r\nThis loan is due to be repaid in full on 27 June 2016.\r\nMr Robinson has been paid once the shipment has been completed, the income he received is US$2,911,500.  Mr Robinson has entered six months custodian banking  arrangement with HSBC Abu Dhabi on 7 June 2016. And this money is currently in custody of the said bank.  And HSBC  has been made also to wire this money in four tranches to HSBC Western Australia, then enter into my account . \r\nHowever Mr Robinson is not be able to access to his fund until his tax liability to UAE for the amount of  US$600K has been paid. He also owes Eadad oil and gas consulting about US$100K for the issuing of licensing fees. \r\nMr Robinson does not have fund to pay the tax and the Eadad, so he has been trying  raise fund about US$600k  privately since 7 June 2016.  I believe he is on the verge to getting the fund. \r\nOur relationship dissolved on 12 June 2016.  Mr Robinson demanded the extension of the repayment date for our A$126K short term loan to December 2016, without giving any valid reason. Also date,  I donâ€™t hold any valid title for the two  real estate properties that as collateral.  Therefore, this loan is unsecured loan. Mr Robinson stated that he would repay the loan whenever he sees  fit. \r\nI would like to take action to:\r\n1.	lay claims on his HSBC custodian account, so the debt will be paid as soon as the fund is leaving the account.\r\n2.	Take measure to stop Mr Robinson from leaving UAE until this debt is paid in full. \r\nPlease advice the most cost effective approach. Also the cost for the debt collection. \r\nThe reason for me to have the debt paid in full before he leaves UAE, Mr Robinson does not own the property in Western Australia, he has two daughters are all in the United States. I am suspecting that once Mr Robinson leaves the UAE,  he will become un contactable, therefor default on this debt.  My judgment  on the amount of time that takes for Mr Robinson to raise the fund and  for HSBC Abu Dhabi  to do the transfer in four tranches. Would be about two weeks at least. \r\n\r\nFrom my judgment  on the amount of time that takes for Mr Robinson to raise the fund and  for HSBC Abu Dhabi  to carry out the transfer in four tranches. Would be about two weeks at least. \r\nSo we would like to take action immediately. \r\n', 0, '203.213.61.101'),
