(37, 'Ramesh Rao', 'GM', 'India', '', 'info@jaykamal.com', '0506402887', 'Ras Al Khaimah', 'PO BOX 30154', '', '', '', '', 'hashem khamis', 'Businessman', 'Egypt', 'tableya restaurant  and cafe', '', '0555504901', 'Dubai', 'bay square blgd no. 10 business bay', '', '', '40000', 'aed', 0, 0, 0, 0, 1, 'i was his land lord. gave me post dated cheques. then he requested me not to put ondate as it may bounce etc and paid me cash. one last cheque is there for 40000 aed. dated 10 Feb 2015. now he is not taking phone. Rich man. no replies on sms/whatsup. need to get this money. let me know your rates also. i have an old agreement with him (ejari), which is no longer valid.', 'More than 2 years', '', 0, '83.110.231.171'),
(38, 'Peter Trans', 'CEO', 'Denmark', 'PAOP Holding APS', 'peter@sanity.dk', '4593939384', 'Denmark', 'Gulbjergvej, 40', '', '4593939384', 'Landlord', '', 'Palm Sports LLC', '', 'United Arab Emirates', '', '', '', '', '', '', '', '50.000,-', 'AED', 1, 0, 0, 0, 0, '', 'February 2014', 'I hereby attach the email correspondence with Mr. Ammar at Palm Sports. I received the cheque in August 2014 and handed it over to my danish bank; Nykredit. In July/August 2015 my accountant said that the money were not on my account and I contacted my danish bank. They informed me that the cheque were rejected by FGB and that they had sent the rejected cheque back to me. I never received the rejected cheque. Then I contacted Palm Sports and the latest communications with Palm Sports are in the attachment. I told Palm Sports that the cheque were rejected. They confirmed that the cheque were of course not redeemed. In two minutes they could cancel cheque number 755978 and issue a new one. But they constantly ask for more information or tell that it has been processen even that it has not.\r\n\r\nI already sent a copy of the rejected cheque and the rent-contract to you.\r\n\r\nKind regards\r\nPeter Trans', 0, '5.30.83.37'),
