(43, 'Jack Kaufman', '', 'United States', '', 'jackryankaufman@gmail.com', '0015615686286', 'United States', '', '', '0', 'Personal Debt Collection', '', 'Ajoy Lopez', '', '', '', '', '', '', '', '', '', '1265/00', 'USD', 0, 0, 0, 0, 1, 'Hello There,\r\n\r\nMy name is Jack Kaufman, I am a former resident of Dubai that recently returned to my home in the U.S. I worked with a man named Ajoy Lopez of Right Way Shipping to ship my car here (from DXB to USA). There were some unforeseen charges that I covered and he said he would reimburse me, but it has been 6 months and he is still not paying me back. The amount is 1265.00 USD. He constantly lies, makes up excuses and begs for extensions, but it is hard to enforce anything from America. \r\n\r\nI have supporting documents and would love to share all the details of my situation. Thank you. ', '', '', 0, '24.250.191.84'),
