(7, 12, 2, 3, '', 1, 0, 0, 'Criminal Law Services', 'Uae Debt Collection-Criminal Law Services|Filing criminal case in uae| Filing Criminal,Civil Cases |Top Lawyer Service Providers| Tax Cases | Public Offense cases|Bounce Cheque Cases| Frauds Handling|', '<p>The United Arab Emirates (UAE) Criminal Law contains many terms taken from the Islamic law of Sharia. Therefore lawyers must understand the Islamic Sharia Law with the modern International Criminal Law for dealing properly with the United Arab Emirates Criminal Law System. The Criminal Law of UAE engulfs each part6 of the crime i.e. Financial Crimes, Sexual Abuse, Drinking, Forgery, Breaking of Trust, Violation, Human Rights and so on. The UAE Debt collection Associated Criminal Defense Lawyers and Legal Consultants defend their clients in every court of UAE and Abu Dhabi. Our Criminal Lawsuit offers their services to the clients in from Police Station to the Federal Supreme Court. The litigation of UAE consists of three degrees i.e. First Instance, Appeal, Cassation or High Instance. Our legal Services are offered to both the victimized or the accused party. Our associated lawyers can help you by using their high-professional skills to assist you from Legal Advice to Legal Services.Our associated lawyers and advocates are highly experienced and can represent you in every Criminal Case Including:</p>\r\n<ul>\r\n<li>&nbsp;State Security-related Crimes</li>\r\n<li>&nbsp;Public Employees-related Crimes</li>\r\n<li>&nbsp;Crimes against Justice</li>\r\n<li>&nbsp;Public Danger-related Crimes</li>\r\n<li>&nbsp;Beliefs and Rituals-related Crimes</li>\r\n<li>&nbsp;Family-related Crimes</li>\r\n<li>&nbsp;Crimes against individuals</li>\r\n<li>&nbsp;Financial Crimes</li>\r\n<li>&nbsp;Forgery</li>\r\n<li>&nbsp;Insolvency</li>\r\n<li>&nbsp;Tax Evasion</li>\r\n<li>&nbsp;Wrong Use of Power</li>\r\n<li>&nbsp;Cyber Crime</li>\r\n<li>&nbsp;Domestic Violence</li>\r\n<li>&nbsp;Driving</li>\r\n<li>&nbsp;Public office offense</li>\r\n<li>&nbsp;Bounced Cheques</li>\r\n<li>&nbsp;Human rights Violation</li>\r\n<li>&nbsp;Fraud and so on</li>\r\n</ul>\r\n<p>The UAE Debt Collection associated Advocates and Legal Consultants offers legal services for criminal law in every state of UAE including Abu Dhabi, Dubai, Sharjah, Ajman, Fujairah, Ras Al Khaimah. Our Criminal Lawyers and Advocated assist their clients from the Police Station to the Federal Supreme Court and till the Final Judicial Declaration of the Case.</p>', 'page-6517379515667112551106216.jpg', '2019-08-25', NULL, NULL, NULL, NULL),
(8, 14, 2, 3, '', 1, 0, 0, 'Civil Law Services', 'UAE Debt Collection | Civil cases Filing in UAE |Commercial and Corporate disputes handling |Family Disputes|Morgage Cases| Unpaid Liablities |Real Estate Disputes|', '<p>The geographical location of a country or state means a lot in its importance all over the globe. UAE has become the center of attention and cardinal importance because of its geographical position. It has successfully gained the attention of several international businesses, companies, and investments by<br />introducing free trade. For the achievement of the best ventures, UAE has introduced several laws and rules for the nationals, foreigners, company or establishments doing business in the UAE has to follow those rules for the accurate functioning of the state system. Violation or defiance of any of these rules may be entitled as civil misconduct. Disagreements or disputes between people or companies which may include commercial, property, family, maritime and intellectual property etc. are related to civil affairs. Our legal civil Lawyers/Attorneys provides consultancy to all the individuals, businesses as well as organizations keeping in mind the nature and the requirements of the business. We offer legal consultancy to our clients ranging from evaluating business agreements to drafting and arranging complex business<br />negotiations also, assisting our clients in court and before government departments all over the UAE and globally through our affiliations internationally. We offer legal services to our clients in every type of cases related to civil law which include and not<br />limited to:</p>\r\n<ul>\r\n<li>Commercial and Corporate Disputes</li>\r\n<li>Family Disputes</li>\r\n<li>Violence</li>\r\n<li>Fraud</li>\r\n<li>Compensations</li>\r\n<li>Mortgage Cases</li>\r\n<li>Unpaid Liabilities</li>\r\n<li>Intellectual Property Rights</li>\r\n<li>Property Disputes</li>\r\n<li>Real Estate Disputes</li>\r\n</ul>\r\n<p>Our team of highly professional Civil Lawyers has been offering their services in all the states of United Arab Emirates (UAE) for more than two decades and is dedicated to assist individuals in every area of Civil Law, which includes debt collection/ debt recovery, compensations, resolution of disputes and vice versa. UAE Debt Collection provides their clients with the professional legal services focusing on resolving issues and disputes in a very convenient way and at the earliest.</p>', 'page-a0f3601d156671210810153201.jpg', '2019-08-25', NULL, NULL, NULL, NULL),
(9, 13, 2, 3, '', 1, 0, 0, 'Family Law', 'UAE Debt Collection | Family Law Services | Divorce Cases | Custody and Alimony Cases | Domestic Violence Cases | Top Lawyers in the Middle East | Best Lawyer Services in UAE', '<p style="text-align: justify;">UAE Debt Collection has highly professional and knowledgeable lawyers with experience in consulting all types of laws related to family law. Contented issues that are decided in family court through legal proceedings are painful and sensitive. A lawyer is actually the man of the hour who can assist you in this hard time. The need for the experienced and knowledgeable lawyer who represent your case and help you in protecting your rights cannot be ignored. Our advocates experienced in family law is always ready to take your case and represent you before the judiciary in a wide range of disputes related to Divorce, Custody, Alimony and Domestic Violence.</p>\r\n<p><strong>Divorce Cases:</strong></p>\r\n<p>It is a miserable fact that marriages break-down or come to an end. When the couples are no longer happy in their marriage life and separation or divorce is the only solution to the problem then our lawyers and advocates experienced in Sharia Law or UAE Family law, which mostly covers the Muslim marriages, will come to the help of the clients or the couples who want separation or divorce. We also offer legal consultancy to the couples belong to other nationalities according to their laws and litigations.</p>\r\n<p><strong>Custody and Alimony Cases:</strong></p>\r\n<p>We always endeavor our best to represent our clients in court and deliver the results keeping in mind the interests of our client. Whether the case is related to child guardianship, support or alimony. The guardianship or safekeeping of the kid is also included. We identify the significance of being sensitive to the obligations and affection. While keeping in mind that sometimes the supporting and conclusive efforts may result in the best interest of the client.</p>\r\n<p><strong>Domestic Violence Cases:</strong></p>\r\n<p>Violence can result in serious injury and can cause psychological disorder. If a person or an individual is a victim of domestic violence, he must consult a legal consultant or professional lawyer. Our group of knowledgeable advocates or lawyers will better assist you in reporting your complaint to the known authorities and will give you the advice to secure yourself and also the family members. Besides the above cases the advocates or lawyers of UAE Debt Collection can best guide you in the arrangement of marriage agreements and also will come to your aid in cases related to inheritance and spousal support. Our highly professional lawyers will do their best in delivering your interests and goals as soon as possible. Our professional advocates and lawyers experienced in divorce law will assist you with your family- related disputes and we will offer you complete legal services by means of litigation, dialogue or negotiation.</p>', 'page-9cac2ca5156671198510023489.jpg', '2019-08-25', NULL, NULL, NULL, NULL),
(10, 11, 1, 0, '', 1, 0, 0, 'Practice  Sectors', 'Practice  Sectors', '<p><span>We provides sophisticated legal services in a broad range of practice areas.&nbsp; This breadth and depth of knowledge allows us to serve our clients and to address the legal and business challenges they encounter.&nbsp; The collaboration we encourage and foster among attorneys in these practice areas ensures that our clients receive&nbsp;professional service and accessibility when they need it.&nbsp; To learn more about the extensive and diverse nature of our services, please click on the list below.</span></p>\r\n<p>We operate in vast variety of sectors&nbsp; like :-</p>\r\n<ul>\r\n<li>Manufacturing</li>\r\n<li>Finance</li>\r\n<li>Sales</li>\r\n<li>Transport</li>\r\n<li>Engineering</li>\r\n<li>Technology</li>\r\n<li>Mining</li>\r\n<li>Goals</li>\r\n<li>Agriculture</li>\r\n<li>Retail</li>\r\n<li>Production</li>\r\n<li>Distribution</li>\r\n<li>Research</li>\r\n<li>Investment</li>\r\n<li>Management</li>\r\n<li>Telecommunication</li>\r\n<li>Insurance</li>\r\n<li>Healthcare</li>\r\n<li>Trade</li>\r\n<li>Education</li>\r\n<li>Marketing</li>\r\n<li>Real Estate</li>\r\n<li>Bank</li>\r\n<li>Food</li>\r\n<li>Plastic</li>\r\n<li>Phramaceuticals</li>\r\n<li>Food Industry</li>\r\n<li>Design</li>\r\n<li>Rail Transport</li>\r\n<li>Financial Services</li>\r\n<li>Computer Software</li>\r\n<li>Advertising</li>\r\n<li>Steel</li>\r\n<li>Computers</li>\r\n<li>Communication</li>\r\n<li>Textile Industry</li>\r\n<li>Publishing</li>\r\n<li>Hotel</li>\r\n<li>Utlities</li>\r\n<li>Coal</li>\r\n<li>Chemical Industry</li>\r\n<li>Energy</li>\r\n</ul>\r\n<p>We are one of Top Debt collection agency in accross the Middleeast, who can handle legal services related to these industries.&nbsp;</p>', 'page-58e16dc7156671927210662622.jpg', '2019-08-25', NULL, NULL, NULL, NULL),
(11, 1, 2, 10, '', 1, 0, 0, 'Banking and Finance', 'UAE Debt Collection-Bankruptcy &  Financial Restructuring |  Banking Sector | Bankruptcy Services| Bankruptcy Lawyers | Workout Lawyers | Finance Lawyers | Litigation services| Best Law Service agency in UAE', '<p>With more than 15 full-time bankruptcy and workout lawyers, Moore &amp; Van Allen has one of the largest bankruptcy and restructuring groups in the region.&nbsp; Our team includes seasoned litigators, accomplished negotiators, and creative problem solvers.&nbsp; Our size and breadth of experience make us capable of meeting virtually any bankruptcy or restructuring need that a company or lending institution may have.</p>\r\n<p>As bankruptcy lawyers, Moore &amp; Van Allen&rsquo;s Bankruptcy and Financial Restructuring team possesses both the transactional and litigation experience necessary to represent a wide array of clients effectively.&nbsp; We have experience navigating the ever-shifting alliances among various creditor constituencies, from first-day cash collateral disputes to plan negotiations.&nbsp; Our extensive representation of financial institutions makes us particularly well-suited to document and negotiate DIP and exit-financing facilities.&nbsp; We also frequently assist buyers at bankruptcy auctions, parties facing assumption or rejection of leases in bankruptcy, trade creditors asserting reclamation claims or defending preference actions, and other creditors who are simply trying to understand the ramifications of a bankruptcy filing.&nbsp; In addition, we periodically serve as counsel to debtors and unsecured creditors&rsquo; committees.&nbsp; We have advocated for virtually every kind of creditor in bankruptcy proceedings and have represented clients in federal bankruptcy courts across the country.&nbsp;</p>\r\n<p><strong>Representative Bankruptcy Matters</strong></p>\r\n<p>As workout lawyers, Moore &amp; Van Allen&rsquo;s Bankruptcy and Financial Restructuring team offers experience and demonstrated success to both lenders and borrowers seeking to resolve financial challenges outside of bankruptcy.&nbsp; We frequently collaborate with our lender clients to develop creative solutions for working out troubled credits, including debt-for-equity swaps and other change of control transactions designed to align the capital structure of an enterprise with economic realities.&nbsp; These transactions are tailored to be tax efficient and preserve key employee, vendor, and customer relationships.&nbsp; In addition, we have successfully helped numerous corporate clients restructure their obligations and avoid bankruptcy.&nbsp;</p>\r\n<p><strong>Representative Workout Matters</strong></p>\r\n<p>As litigators, we represent clients in resolving adversary proceedings and other insolvency related litigation.&nbsp; We often defend parties in preference, fraudulent transfer and other avoidance actions that are commonly used by debtors against creditors that have received payments before the debtor&rsquo;s bankruptcy filing.&nbsp; We typically attempt to resolve these matters amicably, but when circumstances require litigation, we fully and zealously defend our clients.&nbsp;</p>\r\n<p><strong>Representative Litigation Matters</strong></p>\r\n<p>As finance lawyers, the Bankruptcy and Financial Restructuring team works closely with the firm&rsquo;s Financial Services and Corporate teams to ensure that lending and corporate transactions are scrutinized from every angle.&nbsp; We are actively involved in the documentation of transactions.&nbsp; We have particular experience negotiating the terms of intercreditor relationships and we regularly assist clients in evaluating the bankruptcy risks associated with new financial products and transaction structures.&nbsp;</p>\r\n<p style="margin: 0px; padding: 5px 0px 15px; color: #555555; font-family: Lato, arial, sans-serif; font-size: 16px;">With more than 15 full-time bankruptcy and workout lawyers, Moore &amp; Van Allen has one of the largest bankruptcy and restructuring groups in the region.&nbsp; Our team&nbsp;includes seasoned litigators, accomplished negotiators, and creative problem solvers.&nbsp; Our size and breadth of experience make us capable of meeting virtually any bankruptcy or restructuring need that a company or lending institution may have.</p>\r\n<p style="margin: 0px; padding: 5px 0px 15px; color: #555555; font-family: Lato, arial, sans-serif; font-size: 16px;"><strong>As bankruptcy lawyers</strong>, Moore &amp; Van Allen&rsquo;s Bankruptcy and Financial Restructuring team possesses both the transactional and litigation experience necessary to represent a wide array of clients effectively.&nbsp; We have experience navigating the ever-shifting alliances among various creditor constituencies, from first-day cash collateral disputes to plan negotiations.&nbsp; Our extensive representation of financial institutions makes us particularly well-suited to document and negotiate DIP and exit-financing facilities.&nbsp; We also frequently assist buyers at bankruptcy auctions, parties facing assumption or rejection of leases in bankruptcy, trade creditors asserting reclamation claims or defending preference actions, and other creditors who are simply trying to understand the ramifications of a bankruptcy filing.&nbsp; In addition, we periodically serve as counsel to debtors and unsecured creditors&rsquo; committees.&nbsp; We have advocated for virtually every kind of creditor in bankruptcy proceedings and have represented clients in federal bankruptcy courts across the country.&nbsp;</p>\r\n<p style="margin: 0px; padding: 5px 0px 15px; color: #555555; font-family: Lato, arial, sans-serif; font-size: 16px;"><a style="color: #497cba; text-decoration-line: none;" href="http://www.mvalaw.com/experience-5.html">Representative Bankruptcy Matters</a></p>\r\n<p style="margin: 0px; padding: 5px 0px 15px; color: #555555; font-family: Lato, arial, sans-serif; font-size: 16px;"><strong>As workout lawyers</strong>, Moore &amp; Van Allen&rsquo;s Bankruptcy and Financial Restructuring team offers experience and demonstrated success to both lenders and borrowers seeking to resolve financial challenges outside of bankruptcy.&nbsp; We frequently collaborate with our lender clients to develop creative solutions for working out troubled credits, including debt-for-equity swaps and other change of control transactions designed to align the capital structure of an enterprise with economic realities.&nbsp; These transactions are tailored to be tax efficient and preserve key employee, vendor, and customer relationships.&nbsp; In addition, we have successfully helped numerous corporate clients restructure their obligations and avoid bankruptcy.&nbsp;</p>\r\n<p style="margin: 0px; padding: 5px 0px 15px; color: #555555; font-family: Lato, arial, sans-serif; font-size: 16px;"><a style="color: #497cba; text-decoration-line: none;" href="http://www.mvalaw.com/experience-3.html">Representative Workout&nbsp;Matters</a></p>\r\n<p style="margin: 0px; padding: 5px 0px 15px; color: #555555; font-family: Lato, arial, sans-serif; font-size: 16px;"><strong>As litigators</strong>, we represent clients in resolving adversary proceedings and other insolvency related litigation.&nbsp; We often defend parties in preference, fraudulent transfer and other avoidance actions that are commonly used by debtors against creditors that have received payments before the debtor&rsquo;s bankruptcy filing.&nbsp; We typically attempt to&nbsp;resolve these matters amicably, but when circumstances require litigation, we fully and zealously defend our clients.&nbsp;</p>\r\n<p style="margin: 0px; padding: 5px 0px 15px; color: #555555; font-family: Lato, arial, sans-serif; font-size: 16px;"><a style="color: #497cba; text-decoration-line: none;" href="http://www.mvalaw.com/experience-6.html">Representative Litigation Matters</a></p>\r\n<p style="margin: 0px; padding: 5px 0px 15px; color: #555555; font-family: Lato, arial, sans-serif; font-size: 16px;"><strong>As finance lawyers</strong>, the Bankruptcy and Financial Restructuring team works closely with the firm&rsquo;s Financial Services and Corporate teams to ensure that lending and corporate transactions are scrutinized from every angle.&nbsp; We are actively involved in the documentation of transactions.&nbsp; We have particular experience negotiating the terms of intercreditor relationships and we regularly assist clients in evaluating the bankruptcy risks associated with new financial products and transaction structures.&nbsp;</p>', 'page-faad9525156671312410326940.jpg', '2019-08-25', NULL, NULL, NULL, NULL),
(12, 2, 2, 10, '', 1, 0, 0, 'Tax Planning', 'Closely Held Business & Tax Planning| Individual Tax and estate Planning| Business Planning | Charitable Planning |Trust and Estate Administration |Generation Skipping Transfer Tax | Debt Settlement companies in uae| Lawyers in Dubai', '<p>As one of the East Coast&rsquo;s largest and most experienced private wealth practices, Uae debt collection&rsquo;s Wealth Transfer group provides sophisticated, proactive and personable estate, tax, charitable and business planning for our clients&mdash;high net-worth individuals and families, senior executives of public companies and closely-held businesses.</p>\r\n<p>We routinely implement creative, cutting-edge solutions for business succession, tax planning, estate planning, charitable planning and asset protection planning that add significant value for our clients. We represent clients in numerous jurisdictions, with a particular emphasis on the Southeast.</p>\r\n<p>We generally develop extended relationships with our clients who come to rely on us to coordinate all their legal needs with other MVA practices for litigation, finance, corporate, securities, environmental, real estate and governmental matters. When applicable, we also work collaboratively with the client&rsquo;s other advisors, including other counsel, accountants and investment and insurance advisors.</p>\r\n<p>In <strong>individual tax and estate planning</strong> matters, our attorneys advise on:</p>\r\n<p><strong>Wills</strong></p>\r\n<ul>\r\n<li>Revocable or &ldquo;living&rdquo; trusts, typically in conjunction with &ldquo;pour-over&rdquo; wills</li>\r\n<li>Powers of attorney, health care powers of attorney, living wills and HIPAA authorizations</li>\r\n<li>Irrevocable trusts, including life insurance trusts, grantor trusts, dynasty trusts and trusts funded with closely held business interests</li>\r\n<li>Charitable remainder trusts and charitable lead trusts</li>\r\n<li>Grantor retained annuity trusts (GRATs)</li>\r\n<li>Qualified personal residence trusts (QPRTs)</li>\r\n<li>Limited partnerships, limited liability companies and S corporations</li>\r\n<li>Premarital, prenuptial or post-marital agreements</li>\r\n<li>Qualified and deferred compensation plans, IRA distributions and beneficiary designation planning</li>\r\n<li>Asset and creditor protection, including domestic and offshore trusts</li>\r\n<li>Tax planning to minimize estate, generation-skipping and gift taxes</li>\r\n<li>Charitable planning to maximize the benefit and impact of charitable donations</li>\r\n<li>Acquisition and management of vacation residences, airplanes and investment properties, including fractional options</li>\r\n<li>Fiduciary litigation involving disputes among beneficiaries and fiduciaries of estates and trusts</li>\r\n<li>Life insurance planning, including premium finance transactions</li>\r\n<li>Federal and state tax audits and controversies</li>\r\n<li>International estate planning</li>\r\n</ul>\r\n<p>In closely held <strong>business planning matters</strong>, our attorneys advise on:</p>\r\n<ul>\r\n<li>Choice and creation of appropriate business entity (e.g., C corporation, S corporation, LLC or limited partnership)</li>\r\n<li>General business and business succession planning</li>\r\n<li>Merger and acquisition work</li>\r\n<li>Business entity recapitalizations and reorganizations</li>\r\n<li>Corporate and partnership income tax and planning</li>\r\n</ul>\r\n<p>In <strong>charitable planning matters</strong>, our attorneys advise on:</p>\r\n<ul>\r\n<li>Choice and creation of appropriate charitable entity (e.g., private foundation, public charity, donor advised fund, or charitable trust)</li>\r\n<li>Application for tax-exempt status</li>\r\n<li>Administration of private foundations, public charities and charitable trusts</li>\r\n</ul>\r\n<p>In <strong>trust and estate administration</strong> matters, our attorneys advise on:</p>\r\n<ul>\r\n<li>Probate of wills</li>\r\n<li>Administration of trusts and testate and intestate estates</li>\r\n<li>Distribution of assets to trust and estate beneficiaries</li>\r\n<li>Disclaimers</li>\r\n<li>Post-death tax and business planning</li>\r\n<li>Qualified terminable interest property trust (QTIP) marital deductions and reverse QTIP deductions for generation-skipping transfer (GST) tax purposes</li>\r\n<li>Funding trusts, including formula marital deduction and GST allocation provisions</li>\r\n<li>GST tax allocations</li>\r\n<li>Preparation of trust and estate income tax returns</li>\r\n<li>Preparation of estate tax returns</li>\r\n</ul>\r\n<p>In estate, gift and <strong>generation-skipping transfer tax</strong> matters, our attorneys are regularly involved with:</p>\r\n<ul>\r\n<li>Preparation of gift tax returns</li>\r\n<li>Preparation of estate tax returns</li>\r\n<li>Federal and state estate and gift tax audits</li>\r\n<li>Regular representation before the Internal Revenue Service (both audit and appeals) and extensive Tax Court litigation</li>\r\n</ul>', 'page-def130d0156671326811004067.jpg', '2019-08-25', NULL, NULL, NULL, NULL),
(13, 3, 2, 10, '', 1, 0, 0, 'IT Sector', 'Commercial & Technology Transactions | Information Technology Outsourcing| Business Process Outsourcing| Joint Ventures and Strategic Alliances | Technology and Intellectual Property Licensing Agreements | Sales and Distribution Agreements |Consultin', '<p>UAE Debt Collection&rsquo;s Commercial and Technology Transactions Practice Group is a cross-functional, experienced legal team dedicated to serving our clients&rsquo; needs for legal support in every manner and every phase of commercial and technology transactions. Our attorneys have the experience and passion needed to provide a full range of legal support on a wide array of business arrangements, including outsourcing, strategic alliances and joint ventures, services, procurement, licensing, distribution, consulting, manufacturing and many others.</p>\r\n<p>We can:</p>\r\n<ul>\r\n<li>advise clients on the most effective ways to plan and structure their transactions,</li>\r\n<li>negotiate and document clients&rsquo; business arrangements,</li>\r\n<li>assist clients in management and day-to-day issues associated with their on-going business relationships,</li>\r\n<li>assist clients in transactional disputes,</li>\r\n<li>help clients plan and exit from arrangements that no longer meet their business needs.</li>\r\n<li>We have worked extensively with clients in a number of industries, including financial services, information technology, textile, manufacturing, housing and biotechnology. Each business presents its own unique challenges and we work closely with our clients to ensure that we understand the issues behind their transactions and business relationships.</li>\r\n</ul>\r\n<p>Our team puts the client first. We are responsive to your needs and understand that the business world is fast-paced. Our attorneys are practical, cost effective and committed to providing legal support in the most efficient manner. It is not enough to bring problems to our clients&rsquo; attention&ndash; we believe in finding solutions.</p>\r\n<p><strong>Practice Focus</strong></p>\r\n<p><br />Outsourcing:</p>\r\n<ul>\r\n<li><strong>Information Technology Outsourcing</strong> (software support and development, help desk support functions, data management and processing, etc.)</li>\r\n<li><strong>Business Process Outsourcing</strong> (all manner of back office support operations, call center operations, HR support functions, financial services support)</li>\r\n<li><strong>Joint Ventures and Strategic Alliances</strong> (financial services, manufacturing, cross border, IT, etc.)</li>\r\n<li><strong>Technology and Intellectual Property Licensing Agreements</strong> (application service provider agreements, software as a service arrangements, cloud computing, patent licensing, trademark and copyright licensing, etc.)</li>\r\n<li>Sourcing, Procurement and Supply Chain Related Arrangements (general services agreements, software license and maintenance arrangements, hardware purchase and maintenance agreements, materials purchasing arrangements, manufacturing agreements)</li>\r\n<li><strong>Sales and Distribution Agreements</strong></li>\r\n<li><strong>Consulting Agreements</strong></li>\r\n<li><strong>Staffing Agreements</strong></li>\r\n<li><strong>Cross Border Transactions</strong></li>\r\n<li><strong>Transaction Management and Oversight </strong>(service level issues, supplier management, etc.)</li>\r\n<li><strong>Transaction Disputes</strong></li>\r\n<li><strong>Transaction Planning</strong></li>\r\n</ul>', 'page-176bf621156671339910353521.jpg', '2019-08-26', NULL, NULL, NULL, NULL);
INSERT INTO `cms_pages` (`page_id`, `order`, `level`, `parent`, `position`, `published`, `default`, `featured`, `title`, `page_title`, `content`, `banner`, `date_update`, `slug`, `seo_title`, `seo_keywords`, `seo_description`) VALUES
(14, 4, 2, 10, '', 1, 0, 0, 'Corporate Sector', 'Corporate Services | Mergers and Acquisitions| Commercial and Business Contract Negotiation | Corporate Governance | Economic Incentives | Private Equity and Mezzanine Finance| Debt Settlement companies in uae |Best Debt collection company in middlee', '<p>A dozen Fortune 500 companies, along with many growing middle market businesses, across wide-ranging industries rely on Moore &amp; Van Allen as their corporate counsel. We believe it''s because we create value, with a high level of client service and business-centered advice. We can help your business as well&mdash;whether it is a start-up or an established company&mdash;locally, nationally and internationally.</p>\r\n<p>Our Corporate practice has built a national reputation and we have become one of the Southeast''s largest law firms because of progressive, prudent and timely work for our business clients as we strive to achieve their goals and meet their deadlines. Our clients'' appreciation of our ability to provide solutions to their corporate legal needs is evidenced by our recognition in top rankings systems such as Chambers and Partners USA, U.S. News &amp; World Report''s Best Lawyers, Business North Carolina''s Legal Elite, and North Carolina Super Lawyers, among others.</p>\r\n<p>With some 80 diverse, talented and hardworking attorneys, our Corporate practice group provides our clients&mdash;in manufacturing, finance, transportation, construction, retail, biotech, health care, telecommunications and more&mdash;a full spectrum of quality corporate legal services. We have one of the largest, most experienced teams of business lawyers in the Carolinas, whose capabilities enable us to handle the numerous issues that can arise in a single transaction or in a client''s business activities. Due to the depth and breadth of our legal services, we are able to counsel our clients through all stages of their business development, from start-up entity to publicly traded corporation. A summary of our corporate practice&rsquo;s primary focus areas are listed below.</p>\r\n<p><strong>PRACTICE FOCUS</strong></p>\r\n<p>General corporate, partnership, and limited-liability company matters:</p>\r\n<ul>\r\n<li>Formation of entities, joint ventures and strategic alliances</li>\r\n<li>Investment, buy-sell and shareholder agreements</li>\r\n</ul>\r\n<p><strong>Mergers and Acquisitions:</strong></p>\r\n<p>Represent acquiring or acquired entities, public and private, in taxable and tax-free merger, acquisition or sale transactions, including leveraged buyouts <br />Advise clients on tax, regulatory, securities, environmental, employee benefit, employment and antitrust issues, including Hart-Scott-Rodino requirements<br />Securities &amp; Capital Markets:</p>\r\n<ul>\r\n<li>Initial public offerings, secondary public offerings, and offerings of unregistered private equity and debt placements</li>\r\n<li>Securities matters before federal and state securities regulators</li>\r\n<li>"Going private" transactions</li>\r\n<li>Employee incentive stock and dividend reinvestment plan registration</li>\r\n<li>Reporting, proxy and other federal and state compliance obligations</li>\r\n<li>National securities exchange regulations</li>\r\n</ul>\r\n<p><strong>Commercial and Business Contract Negotiation:</strong></p>\r\n<ul>\r\n<li>Employment and consulting agreements</li>\r\n<li>Supply contracts</li>\r\n<li>Forms of purchase and sale orders</li>\r\n<li>Warranties</li>\r\n<li>Franchise documentation</li>\r\n<li>Transportation agreements</li>\r\n<li>Licensing agreements</li>\r\n<li>Documentary and standby letters of credit</li>\r\n</ul>\r\n<p><strong>Corporate Governance:</strong></p>\r\n<ul>\r\n<li>Advise on duties of directors in change in control transactions, anti-takeover defense measures, going-private transactions, spin-offs and spin-outs, and other related-party transactions, executive and director succession, executive and director compensation, financial reporting irregularities, and internal investigations</li>\r\n<li>Governance structure, board and committee charters and practices, disclosure and compliance policies, director independence, and continued compliance with listing standards</li>\r\n<li>Shareholder demands and proxy proposals</li>\r\n</ul>\r\n<p><strong>Economic Incentives:</strong></p>\r\n<ul>\r\n<li>Coordinate strategy and negotiations with state and local representatives</li>\r\n<li>Site selection and permitting</li>\r\n</ul>\r\n<p><strong>Private Equity and Mezzanine Finance:</strong></p>\r\n<ul>\r\n<li>Representation of sponsors in all aspects of leveraged buy-out transactions</li>\r\n<li>Representation of investors and issuers in subordinated debt, preferred equity and hybrid securities issuances</li>\r\n</ul>', 'page-337cd73a156671377110654073.jpg', '2019-08-25', NULL, NULL, NULL, NULL),
(15, 5, 2, 10, '', 1, 0, 0, 'Economic Development', 'Economic Development| Incentives collection|', '<p>UAE Debt Collection&rsquo;s multidisciplinary Economic Development team works on behalf of domestic and international companies that are locating, expanding, or restructuring their businesses and operations in communities nationwide. Over the past two decades, Moore &amp; Van Allen has provided economic development counsel and representation to companies of all sizes that have in total invested in excess of $14 billion and provided thousands of job opportunities across the United States.</p>\r\n<p>Our team has worked successfully on behalf of clients across the UAE, as well as in Middleast, Europe, Africa and&nbsp; America. We have obtained some of the largest incentive packages that several Southeastern states have ever offered to industrial manufacturing facilities.</p>\r\n<p>The Economic Development team is comprised of attorneys, CPAs, lobbyists, public affairs professionals, and paralegals who represent a diverse range of the Firm&rsquo;s seventeen practice areas. The depth and breadth of our team enables us to offer insight from every relevant angle. While distinctly different in expertise, every team member does share a commitment and ability to actively listen when clients and site selection consultants share their business goals and project needs. Our guiding objective is to add value for our clients, not only by meeting their deadlines, but also by bringing our experience and energy to bear on their particular matters, meeting and often exceeding their expectations. Our Public Affairs, Taxation, Lobbying, Environmental, Real Estate, and Corporate practice teams and professionals work together to comprise a cohesive and complete combination for our clients.</p>\r\n<p><strong>INCENTIVES</strong></p>\r\n<p>Our work has included obtaining incentives for cable manufacturers; data centers; power plants; regional, North American and international headquarters; auto part manufacturers; compact construction equipment manufacturers; appliance manufacturers; pharmaceutical manufacturers; steel manufacturers; industrial mills; retail stores; distribution centers; and mortgage brokers.</p>\r\n<p><strong>KNOWLEDGE OF THE PROCESS</strong></p>\r\n<p>Over the past two decades, the team has established relationships with government representatives and has developed extensive experience securing state, regional, county, and city level-incentives for clients in a number of states. These relationships have provided us with the knowledge and opportunity to obtain both well-known and less conspicuous incentives for our clients -- we know who, what and how to ask, ensuring all possibilities are examined and incentive benefits are maximized as the incentive packages are compiled.</p>\r\n<p>Our team has successfully collaborated with Departments of Commerce and Revenue, local municipalities, industrial development boards, port authorities, utility companies, and regional partnerships to achieve competitive incentive packages for our clients&rsquo; needs. We have drafted proposed economic development legislation, provided testimony in support of such legislation, and worked with legislative committees to facilitate its passage&ndash;creating new incentive opportunities or expanding eligibility for current incentives to our clients.</p>\r\n<p><strong>CAPABILITIES AND SERVICES</strong></p>\r\n<p>The team adeptly prepares incentive estimates, negotiates with government representatives, and drafts incentive agreements to memorialize negotiations. We meet with local and state commissions, agencies, and development directors and advocate for our clients and their incentive packages at local approval meetings.</p>\r\n<p><strong>INCENTIVE COMPLIANCE</strong></p>\r\n<p>UAE Debt Collecrtion enables clients to realize the incentives negotiated by facilitating and supporting clients&rsquo; compliance with incentive requirements. We employ a qualified staff that has compliance expertise and has built seasoned relationships with various local and state compliance officers. In certain instances, we have negotiated amendments to incentive packages, as the clients&rsquo; needs changed due to economic forces.</p>\r\n<p><strong>SITE SELECTION AND ACQUISITION</strong></p>\r\n<p>UAE Debt Collection&rsquo;s Economic Development team partners with clients to understand their site needs and measure those needs against the merits of potential locations. Our Real Estate attorneys, in particular, frequently coordinate with all external parties involved, including engineers, surveyors and local officials; each and every site need is considered and provided for accordingly. We are equipped to advise clients on acquiring land and facilities, build-to-suit leases, sale-leaseback transactions, and operating leases. Our Corporate attorneys can assist with major equipment purchase agreements and supplier agreements necessary before a new or expanding facility becomes operational.</p>\r\n<p><strong>ENVIRONMENTAL PERMITTING</strong></p>\r\n<p>Moore &amp; Van Allen Environmental attorneys provide advice and counsel and perform thorough due diligence on the land parcels involved in a location or expansion project. This enables our team to comprehensively identify current or future permitting needs and ultimately provides clients with greater peace of mind during the relocation or expansion process. Several of our attorneys have worked for the EPA, Department of Justice, or state environmental agencies. Their experience gives us added insight on how government agencies interpret environmental regulations.</p>\r\n<p>In addition, many of our attorneys have engineering or scientific backgrounds and prior work experience that make it easier for them to understand and provide practical advice regarding complex environmental issues.</p>\r\n<p><strong>GOVERNMENT NEGOTIATION AND RELATIONS</strong></p>\r\n<p>Uae debt collection&rsquo;s Economic Development team includes proficiency in government affairs, which may be strongly relied upon by a client in an expansion or relocation. Our registered lobbyists and communications professionals use a strategic approach to help clients reduce regulatory costs, build public consensus, defeat adverse legislation, and support favorable legislation, thus finding additional value and equity for the expansion or relocation of our clients&rsquo; operations.</p>\r\n<p>Our ultimate goal in this capacity is to protect and bolster our clients&rsquo; operations or objectives on the federal, state and local level through direct advocacy and legislative monitoring. We make it our business to know the needs and sensitivities our clients face in initiating a sophisticated governmental affairs strategy for both existing businesses and new ventures.</p>\r\n<p><strong>BRANDING</strong></p>\r\n<p>At UAE Debt Collection, we understand the full weight of public perception&mdash;particularly in the case of corporate relocation and growth. We have the experience, sophistication, and ability to proactively develop clients&rsquo; &ldquo;brand&rdquo; in a new territory. Misinformation can spread quickly and throw any project off course; however, we are adept at re-framing the issues and developing companies&rsquo; branding campaigns.</p>', 'page-70117ee3156671388710924760.jpg', '2019-08-25', NULL, NULL, NULL, NULL),
(16, 6, 2, 10, '', 1, 0, 0, 'Electronic Discovery Services', 'Electronic Discovery Services', '<p><span>UAE Debt collection has a team of experienced discovery counsel focused on addressing sophisticated litigation discovery issues &mdash; particularly, the issues presented by electronically stored information (commonly known as &ldquo;ESI&rdquo;).&nbsp; Our attorneys consult on discrete issues or, when appropriate, are fully integrated into ongoing disputes.&nbsp; They provide realistic, practical answers to real-world document production problems that are inherent in complex litigation and government investigations. The team develops a reasonable and defensible ESI plan customized to each type of litigation and every volume of information. We also have implemented a range of litigation-support technologies including document-management databases and advanced deposition and trial management software.&nbsp; We strive to stay on the cutting edge of such technology because of the cost savings that accrue to our clients.</span></p>', 'page-2c620a8c156671399610714167.jpg', '2019-08-25', NULL, NULL, NULL, NULL),
(17, 7, 2, 10, '', 1, 0, 0, 'Employee Benefit', 'Employee Benefits  & Compensation | Lawyer Services | Compensation Recovery | Labour Services in UAE | Employee Insurance Services | Drafting Employee Documents | Employee benefits Disputes | Employee Dismissal Disputes |', '<p>The UAE Debt Collection Employee Benefits team provides our large and mid-sized business clients sophisticated legal strategies and state-of-the-art solutions for complex, high-stakes benefits puzzles in a global marketplace.</p>\r\n<p>We&rsquo;ll work closely with you to design and implement retirement plans, incentive plans, welfare packages, etc., that not only comply with increasingly complex IRS, ERISA and other federal and state regulations, but also seize on the opportunities they provide.</p>\r\n<p>Further, our seasoned and responsive team includes senior attorneys with high-level experience in corporate benefits management and in worldwide benefits implementation. So we&rsquo;re sensitive to the needs, deadlines, imperatives and complexities our clients face. We work hard to meet your goals and deadlines to become a trusted and accessible partner while working to maximize benefits and control costs.</p>\r\n<p>Our full range of employee benefits counsel extends to qualified retirement plans, nonqualified deferred-compensation plans, equity-based compensation arrangements, employee stock ownership plans, welfare and fringe benefit plans, employee benefits in mergers and acquisitions, ERISA and fiduciary litigation support, and executive employment and service issues.</p>\r\n<p><strong>Areas of Focus:</strong></p>\r\n<p><strong>Qualified retirement plans:</strong></p>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li>Design and drafting services</li>\r\n<li>Enrollment, compliance and administrative support</li>\r\n<li>Defined benefit and money-purchase pension plans</li>\r\n<li>Cash-balance plans</li>\r\n<li>Profit-sharing and stock-bonus plans</li>\r\n<li>Target benefit plans</li>\r\n<li>Code &sect; 401(k) cash or deferred arrangements</li>\r\n<li>ESOPs</li>\r\n<li>Drafting and maintaining individually designed plans and volume submitter plans</li>\r\n<li>Assisting in plan submission for issuance of favorable IRS determination letters</li>\r\n<li>Preparing and reviewing trust agreements, summary plan descriptions, plan administrative forms, qualified domestic relations orders, plan loan programs, hardship withdrawal programs, and other ancillary plan documents and procedures</li>\r\n<li>Assisting plan sponsors with operational compliance issues, including various contribution and benefit limitations, coverage and nondiscrimination tests imposed on qualified retirement plans</li>\r\n<li>Advising employers of compliance resolution programs and assisting in the determination of self-correction or voluntary correction with IRS approval</li>\r\n<li>Assisting plan sponsors with plan terminations</li>\r\n<li>Advising on reporting and disclosure requirements</li>\r\n<li>Providing support in regulatory audits</li>\r\n<li>Nonqualified deferred compensation plans:</li>\r\n<li>Advising on design and drafting</li>\r\n<li>&ldquo;Top hat" or supplemental executive retirement plans and excess benefit plans</li>\r\n<li>Financing and securing plans with insurance products, "rabbi" trusts, "secular" trusts and similar arrangements</li>\r\n<li>Equity-based compensation arrangements:</li>\r\n<li>Designing, structuring and implementing plans</li>\r\n<li>Incentive stock options</li>\r\n</ul>\r\n<p><strong>Nonqualified stock options</strong></p>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li>Stock appreciation rights</li>\r\n<li>Tandem stock options</li>\r\n<li>&ldquo;Phantom stock" plans and similar equity-based compensation arrangements</li>\r\n</ul>\r\n<p><strong>Employee stock ownership plans:</strong></p>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li>Designing and drafting</li>\r\n<li>Documenting ESOP loans</li>\r\n<li>Leveraged ESOPs in corporate reorganizations</li>\r\n</ul>\r\n<p><strong>Welfare and fringe-benefit plans:</strong></p>\r\n<ul>\r\n<li>Designing and documentation</li>\r\n<li>Insured and self-funded accident or health plans</li>\r\n<li>Dependent-care assistance programs</li>\r\n<li>Premium conversion and other flexible benefit cafeteria plans</li>\r\n<li>Post-retirement welfare benefits</li>\r\n<li>Code &sect; 132 fringe benefit programs</li>\r\n<li>Severance pay arrangements</li>\r\n<li>COBRA, HIPAA, and nondiscrimination plan testing</li>\r\n</ul>\r\n<p><strong>Employee benefits in mergers and acquisitions; ERISA and fiduciary litigation support:</strong></p>\r\n<ul>\r\n<li>Providing ERISA and fiduciary litigation support to MVA litigation section</li>\r\n<li>Providing transactional and due-diligence support to the MVA Business and Financial Services sections</li>\r\n<li>Advising on complex employee benefits issues in corporate mergers and acquisitions and bank finance transactions, including equity-based compensation, golden parachutes and prohibited transactions issues</li>\r\n</ul>', 'page-a51fb975156671408110399508.jpg', '2019-08-25', NULL, NULL, NULL, NULL),
(18, 8, 2, 10, '', 1, 0, 0, 'Labour Disputes', 'Employment and  Labor Services | Recovering Debts in UAE |  Employee compensation Retreival |  Employeee Dimissal Compensation | Employee Resignation Compensation', '<p>UAE Debt Collection&nbsp; Employment and Labor attorneys work hard to defend our clients'' rights before courts, arbitrators and government agencies, and to solve our clients'' problems short of litigation.</p>\r\n<p>We take a proactive approach to labor and employment relations by understanding each client''s business objectives, identifying risks, and assisting in developing strategies to achieve those objectives. In addition to providing management training and policy development, we advise clients daily on responses to labor and employment issues. This combination of education, guidance and prevention results in significant cost savings, as well as establishing a more productive work place.</p>\r\n<p>Our Employment and Labor team has extensive experience in a wide range of federal and state statutory, regulatory and common law rules that govern employer/employee relations, including:</p>\r\n<ul>\r\n<li>National Labor Relations Act (NLRA)</li>\r\n<li>Title VII of the Civil Rights Act of 1964</li>\r\n<li>Americans with Disabilities Act ( ADA)</li>\r\n<li>Age Discrimination in Employment Act (ADEA)</li>\r\n<li>Equal Pay Act (EPA)</li>\r\n<li>Family &amp; Medical Leave Act (FMLA)</li>\r\n<li>Fair Labor Standards Act (FLSA)</li>\r\n<li>Occupational Safety and Health Act (OSHA)</li>\r\n<li>Uniformed Services Employment and Reemployment Rights Act (USERRA)</li>\r\n<li>Executive Order 11246</li>\r\n<li>Employee Retirement Income Security Act (ERISA)</li>\r\n<li>Sarbanes-Oxley whistleblower provisions</li>\r\n<li>Uniform Trade Secret Act (UTSA)</li>\r\n<li>Computer Fraud &amp; Abuse Act (CFAA)</li>\r\n</ul>\r\n<p>We regularly represent clients from coast to coast in various state and federal courts, as well as before administrative bodies-- handling claims of unfair labor practices, discrimination, sexual harassment, employee misclassification and pay disputes, wage and hour disputes, wrongful termination, workers'' compensation, denial of benefits, fiduciary liability, and employment contract disputes.</p>\r\n<p>Our attorneys also represent companies in complex employment litigation involving class actions, collective actions, and actions concerning unfair competition, employee non-compete, nonsolicitation, and confidentiality covenants, as well as trade secret, tortious interference, and employee raiding claims.</p>\r\n<p>Because we are part of a full service law firm, our clients also receive the benefit of the experience of attorneys in Moore &amp; Van Allen''s Employee Benefits, Immigration, Corporate, and Tax teams when any of these issues arises in an employment matter.</p>\r\n<p>Moore &amp; Van Allen''s Employment and Labor team takes great pride in working closely with our clients both on and off-site to provide the legal assistance needed in today''s ever-changing labor and employment scene. Our experience gives us the ability to anticipate and provide solutions in every aspect of the employment relationship.</p>', 'page-acf66648156671454910127805.jpg', '2019-08-26', NULL, NULL, NULL, NULL),
(19, 15, 2, 3, '', 1, 0, 0, 'Debt Collection Services', 'Debt Collection Services | Debt Recovery services | Legal services | Debt Settlement | Top Law agency in UAE', '<p>Debt Collection is one of the most highly demanding services in UAE . Through our Debt Collection Service, we recover your unpaid debts, invoices, bounced cheques,unpaid salaries,mortgage debts etc., which can be a time consuming and hard process. Our Debt collection team are experienced in Negotiation, supervision, alliance and settlement in a effective way to collect the debt amount and handling the cash flow. We can help you not let your debts turn into bad debts.Our network of skilled individuals for global debt recovery utilizes propelled tools to find and contact the debtors in all four corners of the world. We will trace the debtor&rsquo;s data and consistently correspond with them through written and verbal means.Our Company lawyers are well experienced and proficient in almost all languesges in the world which can give your debt recovery in a speedy way.Our debt recovery agency can deal with the issue proficiently and professionally as we are expert in how to deal with debt defaulters. With our assistance, you can save your time, cash and resources to invest in your imperative business and more vital things.</p>\r\n<p>We are one of the top debt collection agency in the middleeast,europe and american regions.We have a team of experienced debt collection lawyers in UAE who are well-experienced in debt collection cases.With our effective services, we have more than ten thousand customers accross UAE. Because of this we have become the top rated debt recovery service agency in the middleeast.</p>\r\n<p>Our debt recovery lawyers in UAE are pursued by individuals and organizations alike to provide their expertise in advisory and representation of bad debt cases. We provide legal representation and advisory services for the following types of lawsuits and legal problems related to debt recovery in the United Arab Emirates:</p>\r\n<ul>\r\n<li>Corporate Legal Services</li>\r\n<li>Commercial &amp; Civil Legal Services</li>\r\n<li>Criminal Legal Services</li>\r\n<li>Legal Help for Financial Crimes</li>\r\n<li>Family Law Advisory &amp; Divorce Cases</li>\r\n<li>Real Estate Lawyers Assistance</li>\r\n<li>Insurance Claim Lawyers Assistance</li>\r\n<li>Banking &amp; Finance Legal Services</li>\r\n<li>Capital Markets Law Firm</li>\r\n<li>Debt Recovery</li>\r\n<li>Contract Drafting Lawyers Assistance</li>\r\n<li>Intellectual Property Lawyers Assistance</li>\r\n<li>Contract Drafting Lawyers Assistance</li>\r\n<li>Engineering &amp; Construction Law Firm</li>\r\n<li>Labor &amp; Employment Lawyers Assistance</li>\r\n<li>Maritime Lawyers Assistance</li>\r\n<li>Attestation Services</li>\r\n<li>Tax Lawyers Assistance</li>\r\n</ul>', 'page-55ed523b156671217310818944.jpg', '2019-08-25', NULL, NULL, NULL, NULL),
(20, 16, 2, 3, '', 1, 0, 0, 'Filing Cases', 'UAE Debt Collection- Filing Cases| Filing Civil cases | Filing Criminal Cases | Case Submission in Court Procedure | Complete Case Handling | Top  Lawyers in UAE', '<p><strong>Starting the Case- Step-1</strong></p>\r\n<p>In order to commence a claim in the UAE, a claim will have to be filed at the relevant court (i.e. the court which has jurisdiction to hear the dispute). The claim needs to set out the basis of the dispute and the remedies sought. A court fee will also need to be paid. All of the documents filed at court and the claim itself will need to be in Arabic or translated into Arabic by an official translator. The court office will then serve the claim on the defendant and the first hearing date will be set. This is usually 2-3 weeks after the claim has been filed.</p>\r\n<p>In the event that the defendant cannot be physically located then the Court will usually order that the claimant assist the Court with finding the address (service by way of guidance). If this is unsuccessful then the Court will usually order that investigations are carried out with various authorities to locate the defendant. If these searches also prove to be unsuccessful then the Court will usually order that service take place by way of publishing the details of the case in a local newspaper.If a defendant ignores a claim or cannot be located it is possible to obtain a judgment in the defendant&rsquo;s absence.</p>\r\n<p>In this stage, for a normal person its difficult o do all these procedure himself. So we have experienced lawyers with us, who can do everything in a perfect way. You just have to send us the appropriate details, we will do it in behalf of you.we have automated CRM notoficvation systems, which will send you continous updates on what is happening with your particular case.</p>\r\n<p><strong>Step 2- Hearings</strong></p>\r\n<p>At the first hearing the parties legal representatives will need to produce their powers of attorney in order to confirm that they are authorized to act on behalf of their clients. If powers of attorney cannot be provided at this hearing the court will usually adjourn the hearing to allow the parties to obtain the necessary powers of attorney.After powers of attorney have been provided by the parties, the court will set another hearing date (again, usually 2-3 weeks later) to allow the defendant to respond to the claimant&rsquo;s claim. The pleadings which are filed by each party are known as memoranda.</p>\r\n<p>The defendant submits its memorandum in response to the claimant&rsquo;s memorandum at the hearing set by the judge.Before the UAE local courts hearings are very short and administrative in nature and are usually merely a way of allowing parties to submit written memoranda which are then addressed by the other party at the next hearing.Each hearing is set usually 2-3 weeks apart and there can be as many hearings as a judge believes are necessary for each party to have adequately stated its position.</p>\r\n<p><br /><strong>Documents needed to disclose?</strong></p>\r\n<p>There is no formal requirement for disclosure before the UAE courts. Parties are not obliged to submit to the court all documents which either support their case or are detrimental to their case. However since a court-appointed expert can ask to see such documents, the appointment of an expert is also a means of investigating the documents which each party to the dispute has in its possession.</p>\r\n<p><strong>How much time it will take?</strong></p>\r\n<p>Once the judge believes that he has sufficient information regarding the dispute he will set a date to hand down judgment. Judgment is handed down in written form (in Arabic). Some Dubai Court of Cassation Judgments are also displayed on the court website with the parties&rsquo; names redacted.</p>', 'page-2912bbee156671232210628940.jpg', '2019-08-25', NULL, NULL, NULL, NULL),
(21, 17, 2, 3, '', 1, 0, 0, 'Legal Document Drafting', 'Legal Document Drafting | Legal Services UAE | Power of Attorney Preperation | Memorandem of Association Preperation | Articles of Association Drafting | Will and Testament Preparing', '<p>Legal document drafting is handled by experienced lawyers as they have enough knowledge on how to prepare it with necessary legal vocabularies and law mentions. A common can face it difficult to prepare it as it needed certain structure and guidelines from the court.For lawyers to be effective in drafting legal documents, they usually study what the courts, attorneys, etc. use as a language when drafting legal documents. They immersed themselves in legal dictionaries to ensure they enrich their vocabulary with the words that they need in getting their message across in a formal manner.</p>\r\n<p>Lawyers also seek the help of manuals and books as guides for drafting legal documents. It gives them the ideas on how to best prepare and compose law-related documents.<br />There are a lot of documents that can be legally drafted by lawyers. And there are a number of legal drafting services in Dubai. That can provide the right people and service to you when it comes to ensuring that your documents are free of errors.</p>\r\n<p><strong>-Memorandem of Association</strong></p>\r\n<p>This document is needed in a limited liability company (LLC)&rsquo;s formation and process of registration. This legal document defines the relationship between an LLC and its shareholders. It shows the name of the company, names of the shareholders, address of the company, and the share distribution.</p>\r\n<p><strong>-Articles of Association</strong></p>\r\n<p>Companies have regulations for their operations, and they are all specified and stated in an article of association. Aside from that, tasks are also laid out on an article of association with regard to how they&rsquo;re going to deal with things, such as appointing directors, issuing of stock shares, handling financial records, paying dividends, etc.</p>\r\n<p><strong>-Power of Attorney</strong></p>\r\n<p>It is a legal document that gives another person (agent) the power to act on behalf of another person (principal, usually the one who makes the POA). More often than not, POA is used by people when they can&rsquo;t be physically around to do certain things, if they are ill, or have a disability that hinders them from doing so</p>\r\n<p><strong>-Will and Testament</strong></p>\r\n<p>It is a legal document that is made by a person, expressing what he wants to happen in the event that he becomes terminally ill or when he dies. There are beneficiaries included when drafting a will or writing a will. Also, a person names an executor (whether a family member, friend, etc.) who will execute the mentioned legal document when the time comes.</p>\r\n<p>&nbsp;</p>\r\n<p>UAE Debt Collection provides legal document drafting, analysis and documentation services for clients. We know that this is an important part of the daily work of a lawyer. Whether you are seeking for performing a legal analysis, legal articles preperation, legal research, or draft of memoranda, we can offer a quality service for you.</p>\r\n<p>We have experts who are well qualified to handle any type of legal drafting in UAE. We ensure that, the work will be done ina verys short span of time.</p>', 'page-a6292668156671242310165830.jpg', '2019-08-25', NULL, NULL, NULL, NULL),
(22, 9, 2, 10, '', 1, 0, 0, 'Insurance Claims', 'Insurance Claims', '<p>Insurance claims recoveries are needed when there is a recoverable amount arising, as a result of a "not at fault" claim. For instance, an insurer pays out for the repairs to their insured&rsquo;s vehicle. The insured is not at fault for the accident and has provided details of the at fault party. The repairs to the vehicle can then be recovered or collected from the at fault party. This recovery or debt collection can be done internally or externally, by a debt collection company.</p>\r\n<p>Many people will have question in their mind, would insurance companies try to perform this complex debt collection process themselves, or do they outsource to a proffessional dent collector company? If they do outsource, at what stage do they do this?</p>\r\n<p><br />The reason why they outsource is simple,your claims team spending valuable time and resources, trying to do a specialist debt collection function, when you would rather them concentrate on what they do best, which is servicing the insured and processing the claim?</p>\r\n<p>The best way is to outsouce immidietly,he professional outsourced service provider can then immediately instigate the debt collection process.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Benefits of outsourcing your insurance claims recoveries</strong></p>\r\n<p><br /><strong>Make Initial Contact</strong></p>\r\n<p>Our clients that outsource immediately, do not have to worry about waiting two to three weeks for a response from the debtor.We make initial contact with the debtor in a friendly way, acting as an agent of the insurance company. We conduct skip tracing if they are un-located, apply for police reports, license or rego searches- all the time consuming tasks that claims officers simply do not have time to do.</p>\r\n<p><strong>Handle Disputes</strong></p>\r\n<p>This can be one of the most time-consuming parts of the recovery process. Quite often, the at-fault parties will dispute either the quantum or liability, or both. We handle all disputes matters by asking for versions of events, getting witness statements, liaising with third party brokers, insurers, any other stakeholders that may be involved. Sometimes this process takes months, so we have a diary process that can look after these cases. we have a structured auto CRM, which will auto remind, auto update and structure things in a right way.</p>\r\n<p><strong>Expertise</strong></p>\r\n<p>A good insurance recoveries company will have staff that all have a full understanding of the General Insurance Code of Conduct, Insurance Code of Practice and the Insurance Contracts Act. They can act as an extension of the insurance company''s claims team, complementing the whole process and making it streamlined. They can provide quick response times for the debtors and other stakeholders. They can provide relationship management between the debtor and the insurance company, acting as a liaison or &ldquo;buffer&rdquo; so the insurance company does not have to deal with potentially time-consuming calls and emails.</p>\r\n<p><strong>Payments and Arrangements</strong></p>\r\n<p>Debt collection companies are the experts in getting payment in full or as close as possible to payment in full. If this cannot be done, collection companies are usually set up with fully automated payment and arrangement processes, so they can monitor and report on installments and repayment cases over a long period.</p>\r\n<p><strong>Saving Money and Time</strong></p>\r\n<p>The biggest saving for an insurer is, of course, the cost of having to hire all these debt collection experts themselves. Costs of claims can be reduced, simply by outsourcing the whole recoveries function to a professional service provider. Saving time is also a major factor. Claims staff are then free to concentrate on helping the insured and getting the claims process completed, without having to worry about skip tracing or debt collection.</p>\r\n<p><strong>Hiring a Debt Collector</strong></p>\r\n<p>UAE debt collection is one of the top debtcollection agency in the UAE. We have agents who are very professional and having years of experience in handling debts.This will save your time and expense from going with inexperienced debt handlers.</p>', 'page-486c0401156671490210988579.jpg', '2019-08-25', NULL, NULL, NULL, NULL),
(23, 1, 2, 2, '', 1, 0, 0, 'Our Practice Industries', 'UAE Debt Collection- Our Practice Industries | Agribusiness|Communications/Electronics| Construction|Defense|Energy & Natural Resources|Finance, Insurance & Real Estate|Health| Ideological/Single-Issue|Labor|Lawyers & Lobbyists|Misc Business| Transpo', '<p>We have&nbsp; lawyers ,who have enormous experience in various industries indealing with anytype of legal services you need. <span>&nbsp;This breadth and depth of knowledge allows us to serve our clients and to address the legal and business challenges they encounter.&nbsp; The collaboration we encourage and foster among attorneys in these practice areas ensures that our clients receive&nbsp;professional service and accessibility when they need it.&nbsp;&nbsp;</span>Our Practice industies are not concentrated on one or two things, whereas it is concentrated on vast many fields.</p>\r\n<p>Industries we concentrate are:-</p>\r\n<p><strong>Agribusiness</strong></p>\r\n<ul>\r\n<li>Crop Production &amp; Basic Processing</li>\r\n<li>Vegetables &amp; Fruits</li>\r\n<li>Sugar Cane &amp; Sugar Beets</li>\r\n<li>Tobacco</li>\r\n<li>Dairy</li>\r\n<li>Poultry &amp; Eggs</li>\r\n<li>Livestock</li>\r\n<li>Agricultural Services &amp; Products</li>\r\n<li>Farm Bureaus</li>\r\n<li>Food Processing &amp; Sales</li>\r\n<li>Food Products Manufacturing</li>\r\n<li>Food Stores</li>\r\n<li>Meat processing &amp; products</li>\r\n<li>Forestry &amp; Forest Products&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</li>\r\n</ul>\r\n<p><strong>Communications/Electronics</strong></p>\r\n<ul>\r\n<li>Printing &amp; Publishing</li>\r\n<li>Books, Magazines &amp; Newspapers</li>\r\n<li>TV / Movies / Music</li>\r\n<li>Cable &amp; Satellite TV Production &amp; Distribution</li>\r\n<li>Commercial TV &amp; Radio Stations</li>\r\n<li>Motion Picture Production &amp; Distribution</li>\r\n<li>Recorded Music &amp; Music Production</li>\r\n<li>TV Production</li>\r\n<li>Telephone Utilities</li>\r\n<l